import 'react-tabs/style/react-tabs.css';

export default function LayerCard({layer}) {

    return(
        <div className="layerCard">
            {layer.name}
            <Tabs>
            <TabList>
            <Tab>Properties</Tab>
            <Tab>Title 2</Tab>
            </TabList>

            <TabPanel>
            <h2>Any content 1</h2>
            </TabPanel>
            <TabPanel>
            <h2>Any content 2</h2>
            </TabPanel>
            </Tabs>
        </div>
    )
}
